import React, { Component } from "react";
class ComponentWillUnmount extends Component(){

    ComponentWillUnmount(){
        console.log("ComponentWillUnmount")
    }
    
    render(){
        return<>
        <h1>Child component</h1>
    </>
    }
  
   
}

export default ComponentWillUnmount;
